    "title": "TEAM LEBRON vs TEAM GIANNIS | 2019 NBA All-Star Game | February 17, 2019",
    "description": "Kevin Durant (31 points, 6-9 3pt FG and 7 rebounds) took home MVP honors for the 2nd time in his career (2012) to lead Team LeBron to a 178-174 victory over Team Giannis tonight in Charlotte. With his 31 points, Durant passed Oscar Robertson (246) for 5th all-time in scoring in All-Star Game history. This is the fifth time Kevin Durant scored 30+ points in an All-Star Game. No other player has done so in an All-Star Game more than three times (K. Bryant/R. Westbrook - 3). LeBron James tallied 19 points (9-17 FG), 8 rebounds and 4 assists in the victory. Additionally, Dwyane Wade recorded 7 points (2-4 FG) and 4 assists for Team LeBron. \n\nGiannis Antetokounmpo led all scorers with 38 points (17-23 FG), along with 11 rebounds and 5 assists for Team Giannis. No player in All-Star Game history has totaled that many PTS/REB/AST in a single performance. In addition, Dirk Nowitzki recorded 9 points (3-3 3pt FG) for Team Giannis. Team LeBron shot 35-90 3pt FG, setting ASG records for both makes and attempts, while both teams combined for 62-167 3pt FG (27-77 for Team Giannis), which are also new ASG records for makes and attempts.\n\nFor Full Game Recaps visit: https://bit.ly/2MQ6ijV \n\nSubscribe to the NBA: http://bit.ly/2rCglzY \n\nFor news, stories, highlights and more, go to our official website at http://www.nba.com\n\nGet NBA LEAGUE PASS: http://www.nba.com/leaguepass\n\n#TeamLeBron #TeamGiannis #NBA",
