    "title": "How Close Are We to Creating a Lightsaber?",
    "description": "Lightsabers might be elegant weapons for a more civilized age, but today, they only exist in the world of fiction. Could we use modern technology to create the most famous movie weapon of all time?\n\nMay the Fourth be with you! \n\nFind Dr. Patrick Johnson's book, The Physics of Star Wars, here: https://www.amazon.com/Physics-Star-Wars-Science-Behind/dp/1507203306 \n\nCheck out Dr. Don Lincoln's YouTube videos for Fermilab here: https://www.youtube.com/watch?v=NLmpNM0sgYk&list=PLCfRa7MXBEsoJuAM8s6D8oKDPyBepBosS \n\nHow Close Are We? Season 3 - https://www.youtube.com/watch?v=Ypm4QcOOqXQ&list=PL6uC-XGZC7X56r8MGLS5rqsr5glQnMdAC \n\nRead More: \nThe Science of Star Wars Weaponry\nhttp://nautil.us/issue/55/trust/the-science-of-star-wars-weaponry \n\"If we consider the beam to be plasma, there is a different set of concerns. A well-designed electromagnetic field could, in principle, contain a plasma to a size of about 3 feet (maybe by sending the plasma in a highly elliptical path to create roughly the shape of a cylinder).\"\n\nIs a Real Lightsaber Possible? Science Offers a New Hope\nhttps://www.space.com/31361-building-a-real-lightsaber.html \n\"What technology could possibly yield the lightsaber? With that desire, came the first attempts to reverse-engineer the device. Reverse engineering, in this context, is thinking about how to do it…not actually building one. However, this research about clumping photons made the rounds a while ago.\"\n\nScientists create never-before-seen form of matter\nhttps://phys.org/news/2013-09-scientists-never-before-seen.html \n\"Harvard and MIT scientists are challenging the conventional wisdom about light, and they didn't need to go to a galaxy far, far away to do it.\"\n\n____________________\n\nHow close are we to colonizing the moon, mapping the human brain and curing cancer? Join Seeker as we go in search of experts, academics and innovators who are racing to solve some of humanity’s biggest scientific challenges. We’ll dive into the facts and comb through the research to find the answers you’re looking for. \n\nSeeker explains every aspect of our world through a lens of science, inspiring a new generation of curious minds who want to know how today’s discoveries in science, math, engineering and technology are impacting our lives, and shaping our future. Our stories parse meaning from the noise in a world of rapidly changing information. \n\nVisit the Seeker website https://www.seeker.com/videos \n\nHow Close Are We? on Facebook https://www.facebook.com/HowCloseAreWe/ \n\nSubscribe now! http://www.youtube.com/subscription_center?add_user=dnewschannel \n\nSeeker on Twitter http://twitter.com/seeker\n\nSeeker on Facebook https://www.facebook.com/SeekerMedia/ \n\nSeeker http://www.seeker.com/",
